      content: >-
        To the atmospherics staff on Glacier Station,


        Automated gas mining is only possible with nitrogen due to the low atmospheric pressure at this altitude. Your task is to filter and heat a controlled amount of oxygen from the thin air and then send it around the station, keeping it breathable.


        The gas inlet pump should be kept at a low speed as to not outpace the heater's capabilities, unless you are using a special setup and are certified in advanced oxygen production.


        This is also a reminder not to dump toxic waste gases down towards the planet below, please store them to be safely disposed of so we are not involved in YET ANOTHER lawsuit from poisoning the local space elk.
